import React, { useEffect, useState } from "react";
import abi from "./abi.json";
import abi_WOW from "./abi_WOW.json";
import Web3 from "web3";
import detectEthereumProvider from "@metamask/detect-provider";
import { toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import axios from "axios";

export default function MintButton() {
  const REACT_APP_CONTRACT_ADDRESS =
    "0x2846573b8b87a034Fc1b42466367400b9F51A83a";
  const REACT_APP_CONTRACT_ADDRESS_WOW =
    "0x34E0473bC128aC922daDc1dDACD421a679a838Ae";
  const SELECTEDNETWORK = "4";
  const SELECTEDNETWORKNAME = "Ethereum";

  const [preview, setPreview] = useState(
    ""
  );
  const [loading, setloading] = useState(false);

  let ct, web3;

  const loadweb3 = async () => {
    if (await detectEthereumProvider()) {
      window.web3 = new Web3(window.ethereum);
      web3 = window.web3;

      await window.ethereum.enable();
      let m = await web3.eth.getAccounts();
      m = m[0];

      if ((await web3.eth.net.getId()) != SELECTEDNETWORK) {
        toast.error('Enable "' + SELECTEDNETWORKNAME + '" network!');
        return false;
      }

      let tId = document.getElementById("WOWID").value;

      const ct_WOW = new web3.eth.Contract(
        abi_WOW,
        REACT_APP_CONTRACT_ADDRESS_WOW
      );

      try {
        if ((await ct_WOW.methods.ownerOf(tId).call()) != m) {
          toast.error("WOW #" + tId + " not found in connected Wallet" + m);
          return;
        }
      } catch (err) {
        toast.error("WOW #" + tId + " does not exist");
        return;
      }

      ct = new web3.eth.Contract(abi, REACT_APP_CONTRACT_ADDRESS);

      // let p = await ct.methods.price().call();
      // let b = await web3.eth.getBalance(m);

      // if (Number(b) < Number(p)) {
      //   toast.error("Insufficient ETH balance!");
      //   return;
      // }

      await toast.promise(ct.methods.mint(tId).send({ from: m }), {
        pending: "Mint in Progress!!",
        success: "Mint Success!!",
        error: "Mint Failed!!",
      });
    } else {
      toast.error(
        "Non-Ethereum browser detected. Please use a crypto wallet such as MetaMask!"
      );
      return false;
    }
  };

  async function loadimage(e) {
    setloading(true);

    axios
      .get(
        "https://worldofoutfits.com/bodies/unnamed-" + e.target.value + ".png",
        { responseType: "arraybuffer" }
      )
      .then((res) => {
        const base64 = btoa(
          new Uint8Array(res.data).reduce(
            (data, byte) => data + String.fromCharCode(byte),
            ""
          )
        );
        setPreview(base64);
        setloading(false);
      });
  }

  return (
    <div className="container-fluid p-0 m-0">
      <div className="row p-0 m-0 justify-content-center align-items-center">
        <div className="col-md-5 p-0 position-relative">
          <img src={`data:;base64,${preview}`} className="w-100 previewimg" />
          <img
            src="/loading.gif"
            className={loading ? "w-25 loading" : "d-none"}
          />
        </div>
        <div className="col-md-7 what_inner_text py-0">
          <h3>
            Claim a body <em>for your WoW</em>
          </h3>
          <input
            id="WOWID"
            type="number"
            class="form-control text-center"
            placeholder="Enter WOW ID"
            min={0}
            max={9999}
            onChange={(e) => loadimage(e)}
          />
          <br />
          <button
            onClick={loadweb3}
            className="bottom-right buttonPink w-100 py-3 px-0"
          >
            Claim Body Free + Gas
          </button>
          <br />
          <br />
        </div>
      </div>
    </div>
  );
}
